import sunscreen from './../images/sunscreen.png';
import foundation from './../images/foundation.png';
import nailcolorRemove from './../images/nailcolor-remover.png';
import instaEyeliner from './../images/insta-eyeliner.png';
import facePack from './../images/sheet-facepack.png';
import shineEyeliner from './../images/shine-eyeliner.png';

const data = {
    products: [
        {
            id: "1",
            image: "./../",
            name: "Face Powder With Sunscreen",
            price: "500", 
        },
        {
            id: "2",
            image: {foundation},
            name: "Weightless Mousse Foundation",
            price: "350", 
        },
        {
            id: "3",
            image: {nailcolorRemove},
            name: "Nail Color Remove",
            price: "100", 
        },
        {
            id: "4",
            image: {instaEyeliner},
            name: "Insta Eye Liner",
            price: "80", 
        },
        {
            id: "5",
            image: {facePack},
            name: "Blush & Glow Strawberry Sheet Mask",
            price: "150", 
        },
        {
            id: "6",
            image: {shineEyeliner},
            name: "Absolute Shine Line Eye Liner ",
            price: "200", 
        },
    ],
};

export default data;
